import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';
import logo from '../assets/images/logo.png';

const Navbar = () => {
    const [isOpen, setIsOpen] = useState(false);

    const toggleMenu = () => {
        setIsOpen(!isOpen);
    };

    return (
        <nav className="navbar">
            <div className="nav-container">
                <Link to="/" className="nav-logo">
                    <img src={logo} alt="Fachri Property Group" className="logo-image" />
                    <span>FACHRI PROPERTY GROUP</span>
                </Link>

                <div className="menu-icon" onClick={toggleMenu}>
                    <i className={isOpen ? 'fas fa-times' : 'fas fa-bars'}></i>
                </div>

                <ul className={isOpen ? 'nav-menu active' : 'nav-menu'}>
                    <li className="nav-item">
                        <Link to="/" className="nav-links" onClick={toggleMenu}>
                            HOME
                        </Link>
                    </li>
                    <li className="nav-item dropdown">
                        <span className="nav-links">
                            TENTANG <i className="fas fa-caret-down"></i>
                        </span>
                        <ul className="dropdown-menu">
                            <li><Link to="/about">Tentang Kami</Link></li>
                            <li><Link to="/team">Tim Kami</Link></li>
                        </ul>
                    </li>
                    <li className="nav-item">
                        <Link to="/properties" className="nav-links" onClick={toggleMenu}>
                            PROPERTI
                        </Link>
                    </li>
                    <li className="nav-item">
                        <Link to="/contact" className="nav-links" onClick={toggleMenu}>
                            HUBUNGI KAMI
                        </Link>
                    </li>
                </ul>
            </div>
        </nav>
    );
};

export default Navbar;
